import InputArea from '../../molecules/InputArea';
import Text from '../../atoms/Text'

const Header = ()=> {
   
    const textInfo = 'Meta';
    const typeInfo = 'h1';
    return (
        <header className = 'header'>
            <div className="header-wrap">
                <div className="logo"><Text text= {textInfo} type ={typeInfo}/> </div>
                <InputArea />
            </div>
        </header>
    )
}

export default Header
